(389, 'f807da9f-8c67-11e3-9764-8fa38e4e9484', '0', '', 'f807da97-8c67-11e3-9764-8fa38e4e9484', 'Блок сопряжения домофона координатный', 'Блок сопряжения для видеодомофонов - адаптация с координатными подъездными домофонами \n\nVizit, Eltis, Cyfral.\n\nС помощью блока возможно подключить к видеодомофону аудио домофон и камеру наблюдения подъездного домофона (если камера установлена)\n\nСхема подключение координатного блока сопряжения:\n\nВидеокабель от монитора и вызывной панели подключается к шлейфу блока сопряжения. На самом блоке последовательно расписан весь шлейф, обозначения каждой жилы указаны на коробке блока.\nОбозначения блока:\n«Audio» — звук.\n«Gnd» — общий.\n\n«+12 В» — питание 12 В.\n\n«Video» — видеосигнал.\n\nНапоминаем обозначения шлейфа монитора:\n\nКрасный — звук.\n\nСиний — общий.\n\nЖелтый — питание 12 В.\n\nБелый — видеосигнал.\n\nНазначение проводов вашей вызывной панели указано в паспорте, либо на обратной стороне панели.\n\nНа один канал монитора видеодомофона координатный блок сопряжения  позволяет подключить подъездную линию аудио домофона, 1 дополнительную камеру установленную в подъездном домофоне, обязательно  запитанную от отдельного блока питания и 1 вызывную панель видеодомофона', '', '0.00', 0, 0, 0, 'item389', '', '', '', 0),
(390, 'f807daa2-8c67-11e3-9764-8fa38e4e9484', '0', '', 'f807da97-8c67-11e3-9764-8fa38e4e9484', 'Блок сопряжения домофона цифровой', 'Блок сопряжения для видеодомофонов - адаптация с цифровыми подъездными домофонами \n\nRaikmann, Rainmann, Filman, Keyman, Proel, Маршал.\n\nС помощью блока возможно подключить к видеодомофону аудио домофон и камеру наблюдения подъездного домофона (если камера установлена)\n\nСхема подключение цифрового блока сопряжения:\n\nВидеокабель от монитора и вызывной панели подключается к шлейфу блока сопряжения. На самом блоке последовательно расписан весь шлейф, обозначения каждой жилы указаны на коробке блока.\nОбозначения блока:\n«Audio» — звук.\n«Gnd» — общий.\n\n«+12 В» — питание 12 В.\n\n«Video» — видеосигнал.\n\nНапоминаем обозначения шлейфа монитора:\n\nКрасный — звук.\n\nСиний — общий.\n\nЖелтый — питание 12 В.\n\nБелый — видеосигнал.\n\nНазначение проводов вашей вызывной панели указано в паспорте, либо на обратной стороне панели.\n\nНа один канал монитора видеодомофона цифровой блок сопряжения  позволяет подключить подъездную линию аудио домофона, 1 дополнительную камеру установленную в подъездном домофоне, обязательно  запитанную от отдельного блока питания и 1 вызывную панель видеодомофона', '', '0.00', 0, 0, 0, 'item390', '', '', '', 0),
(391, '56f2bfb2-8982-11e3-9761-fe0d44449e84', '0', '', '1004f4f7-8974-11e3-9761-fe0d44449e84', 'БП-0,3А', 'БП–0,3 А -  (Источник электропитания). Выходное напряжение 12 В, Номинальное переменное напряжение сети 220 В ± 10 В, Номинальный потребляемый от сети ток 0,012 А, Выходной ток при круглосуточной работе 0.3 А.  \n', '', '0.00', 1, 0, 0, 'item391', '', '', '', 0),
