(400, 'f807daa5-8c67-11e3-9764-8fa38e4e9484', '0', '', 'f807da94-8c67-11e3-9764-8fa38e4e9484', 'Видеодомофон Commax CDV-1020AE', 'Цветной видеодомофон Премиум класса CDV-1020AE с широким (26 сантиметров по диагонали) экраном, сенсорное управление Toch Screen и функцией "картинка в картинке" - выводит на экран изображение с двух камер одновременно. Встроенная энергонезависимая (при отключение от источника питания фото сохраняются) память на 128 кадров, фотографирует посетителя в момент нажатия на кнопку в вызывной панели. Фото фиксируется с датой и временем вызова.\n\nПодключение к многоквартирному ауди домофону с помощью блока сопряжения.\n\nFine View Color LCD технология обеспечивает лучшее качество картинки. Рассчитан на установку 2 вызывных панелей и 2 камер наблюдения, дополнительной трубки интеркома и параллельного подключения второго монитора commax. Максимальная конфигурация подключения - две вызывные панели, две камеры, два монитора и аудиотрубки.\nСхема подключения Commax CDV-1020AE\n\nКрасный — аудиосигнал\nСиний — общий\nЖелтый — питание 12 вольт\nБелый — видео\nТехнические характеристики Commax CDV-1020AE\n\nПроизводитель	Commax Co. Ltd.\nМодель год	2010\nТип экрана	 Fine View Color LCD\nСистема цветности	Мультисистемный\nРазмер экрана по диагонали	10.2 дюймов (25.9 см)\nПодсветка	LED\nРегулировка яркости, контрастности	да\nСистема Hands-free (свободные руки)	да\nРегулировка громкости	да\nКоличество мелодий вызова	1\nТип мелодии	тональный\nВстроенная память	да\nВидеовыходов	4 видео 2 аудио\nТип управления	Toch Screen\nСоединение с вызывной панелью	4-х проводное\nMax длина провода домофон-видеопанель	50 метров\nИнтерфон	есть, DP-4VН\nКорпус	пластик\nЦвет	металлик,черный\nДиапазон рабочих температур	0… +50С\nНапряжение сети	100-240В 50/60Гц.\nПотребляемая мощность	1Вт-6,25Вт\nВес	1,9 кг.\nРазмер (В*Ш*Г)	21.5 см х31.8 см х 3.5 см\nСпособ установки	накладной\nЯзык меню	русский, английский\nИнструкция Commax CDV-1020AE\n\nПодробная инструкция для видеодомофона Commax CDV-1020AE поставляется в комплекте с монитором!\nУстановка Commax CDV-1020AE\n\nСтоимость установки комплекта видеодомофона Commax CDV-1020AE уточняйте у наших менеджеров по телефону. Стандартный монтаж видеодомофона как правило не превышает 4000 тыс рублей с учетом всех расходных материалов.\n\nМодификация Commax CDV-1020AE\n\nАдаптированный для подключения к аналоговыми домофонам - Commax CDV-1020AE/Vizit\n\nАдаптированный для подключения к цифровым домофонам - Commax CDV-1020AE/XL', '', '0.00', 1, 0, 0, 'item400', '', '', '', 0),
(401, 'f807daa8-8c67-11e3-9764-8fa38e4e9484', '0', '', 'f807da94-8c67-11e3-9764-8fa38e4e9484', 'Видеодомофон Commax CDV-1020AQ', 'Цветной видеодомофон Commax CDV-1020AQ без трубки, оснащён современным TFT LCD экраном 26 сантиметров по диагонали ( 10.2 дюйма), на котором происходит управление домофоном - система Touch Screen (без кнопок). К монитору CDV-1020AQ подключается до 4-х вызывных панелей или камер наблюдения, в различных конфигурациях, но при этом все устройства должны быть одного формата Pal или NTCS. CDV-1020AQ отличается от всей линейки Commax встроенным квадратором, который позволяет получать изображение с 4 точек обзора одновременно. При звонке на монитор всегда выводится изображение с 4-х видеокамер, но при необходимости возможно увеличение картинки с камеры, путем нажатия на кнопку.Встроенная энергонезависимая память на 128 кадров (при отключение от источника питания фото сохраняются), фотографирует посетителя в момент нажатия на кнопку в вызывной панели. Фото фиксируется с датой и временем вызова, одновременно с четырех камер. Монитор может выполнять функции стационарного городского телефона (является основной базой для DECT трубок Commax). Возможно подключить до 4 беспроводных DECT трубок Commax CDT-180 (приобретается отдельно) с их помощью можно общаться "трубка-трубка", управлять электрозамками, и конечно использовать как обычные DECT телефоны. \n\nПодключение к многоквартирному ауди домофону с помощью блока сопряжения. \n\nFine View Color LCD технология обеспечивает лучшее качество картинки. Рассчитан на установку 2 вызывных панелей и 2 камер наблюдения, дополнительной трубки интеркома и параллельного подключения второго монитора commax. Максимальная конфигурация подключения - две вызывные панели, две камеры, два монитора и 4 беспоровдных DECT аудиотрубок.\nСхема подключения Commax CDV-1020AQ\n\nКрасный — аудиосигнал \nСиний — общий \nЖелтый — питание 12 вольт \nБелый — видео\nТехнические характеристики Commax CDV-1020AQ\n\nПроизводитель Commax Co. Ltd. Модель год 2010 \nТип экрана Fine View Color LCD \nСистема цветности Мультисистемный \nРазмер экрана по диагонали 10.2 дюймов (25.9 см) \nПодсветка LED \nРегулировка яркости, контрастности да \nСистема Hands-free (свободные руки) да\nРегулировка громкости да \nКоличество мелодий вызова 1 \nТип мелодии тональный \nВстроенная память да \nВидеовыходов 4 видео 2 аудио \nТип управления Toch Screen \nСоединение с вызывной панелью 4-х проводное \nMax длина провода домофон-видеопанель 50 метров \nИнтерфон есть, DP-4VН \nКорпус пластик Цвет металлик,черный \nДиапазон рабочих температур 0… +50С \nНапряжение сети 100-240В 50/60Гц. \nПотребляемая мощность 1Вт-6,25Вт \nВес 1,9 кг.\nРазмер (В*Ш*Г) 21.5 см х31.8 см х 3.5 см \nСпособ установки накладной \nЯзык меню русский, английский\nИнструкция Commax CDV-1020AQ\n\nПодробная инструкция для видеодомофона Commax CDV-1020AQ поставляется в комплекте с монитором!\nУстановка Commax CDV-1020AQ\n\nСтоимость установки комплекта видеодомофона Commax CDV-1020AQ уточняйте у наших менеджеров по телефону. Стандартный монтаж видеодомофона как правило не превышает 4000 тыс рублей с учетом всех расходных материалов.\nМодификация Commax CDV-1020AQ\n\nАдаптированный для подключения к аналоговыми домофонам - Commax CDV-1020AQ/Vizit \nАдаптированный для подключения к цифровым домофонам - Commax CDV-1020AQ/XL', '', '0.00', 1, 0, 0, 'item401', '', '', '', 0),
