(413, 'f807dacc-8c67-11e3-9764-8fa38e4e9484', '0', '', 'f807da94-8c67-11e3-9764-8fa38e4e9484', 'Видеодомофон Commax CDV-71AM', 'Цветной видеодомофон с монитором 7 дюйма без трубки. Самый продаваемый монитор с 2010 года, на четыре видеовыхода. \nПодключение к многоквартирному ауди домофону с помощью блока сопряжения.\n\nFine View Color LCD технология обеспечивает лучшее качество картинки. Рассчитан на установку 2 вызывных панелей и 2 камер наблюдения, дополнительной трубки интеркома и параллельного подключения второго монитора commax. Максимальная конфигурация подключения - две вызывные панели, две камеры, два монитора и аудиотрубки.\n\nВидеодомофон «CDV-71AM Commax» обеспечит великолепную защиту Вас и Вашей семьи. Данная модель потребляет совсем небольшое количество энергии: около17 Вт при непосредственном общении по нему и всего 1Вт в режиме ожидания. Еще одной важной характеристикой этой модели является функция «картинка в картинке» или «PIP». Наблюдения того, что происходит снаружи могут вестись от нескольких камер одновременно, под разным ракурсом. На мониторе Вашего домофона будет высвечиваться сразу несколько картинок. Никакой вор или грабитель отныне не сможет проникнуть в Ваш дом под видом почтальона или сантехника. Видеонаблюдение намного лучше обыкновенного зрачка. Объем памяти «COMMAX» – энергонезависимый, рассчитан на 128 кадров. Также языковую панель Вы подбираете на свое усмотрение. Фирма «COMMAX» гарантирует своим клиентам отсутствие проблем в установке и пользовании домофоном. По своему желанию именно Вы устанавливаете резкость, четкость, яркость и контрастность изображения. «CDV-71AM» оснащен специальной функцией трубки «Свободные руки»: Вы без лишних движений можете из соседней комнаты открыть входную дверь. Диапазон рабочей температуры домофона колеблется от 0С° до 50С°. Материал, из которого сделана модель «CDV-71AM» – обыкновенный пластик, имитирующий металл. 243 х 168 х 35 мм. И почти 2 кг. – вот Ваш постоянный надежный сторож квартиры.\nСхема 