(416, '28301729-8c6c-11e3-9764-8fa38e4e9484', '0', '', 'f807da96-8c67-11e3-9764-8fa38e4e9484', 'Видеодомофон Kocom KCV-301', 'Видеодомофон Kocom KCV-301 цветной с дисплеем 3.5 дюйма- 9 сантиметров, с трубкой простейшая его модификация от корейской компании Kocom. KCV-301 является самым бюджетный домофоном у фирмы Kocom. Поддерживает подключение до 2 вызывных панелей или камер. Возможно подключение до 4-х домофонов в параллель к вызывной панели. Встроенный блок питания. Возможна адаптация к подъездному аудиодомофону через блок сопряжения.\n\nСхема подключения Kocom KCV-301\n\nКрасный — аудиосигнал\nСиний — общий\nЖелтый — питание 12 вольт\nБелый — видео\nТехнические характеристики Kocom KCV-301\n\n- TFT LCD 3,5",\n- 2 вызывные панели,\n- 4 монитора в параллель,\n- возможность подключения памяти KVR-300 и аудиотрубок KDP-602G, KW-1121,\n- DC 220В, 26W,\n- 210x222x57мм.\n\nИнструкция Kocom KCV-301\n\nПодробная инструкция на русском языке для видеодомофона Kocom KCV-301 поставляется в комплекте с монитором!\nУстановка Kocom KCV-301\n\nСтоимость установки комплекта видеодомофона Kocom  KCV-301 уточняйте у наших менеджеров по телефону. Стандартный монтаж видеодомофона как правило не превышает 4000 тыс рублей с учетом всех расходных материалов.', '', '0.00', 1, 0, 0, 'item416', '', '', '', 0),
(417, '2830172c-8c6c-11e3-9764-8fa38e4e9484', '0', '', 'f807da96-8c67-11e3-9764-8fa38e4e9484', 'Видеодомофон Kocom KCV-401EV', 'Цветной видеодомофон Kocom KCV-401EV - 4- дюймовый четырех-проводный цветной монитор без трубки. Отличительной особенностью домофона наличие сенсорных кнопок с подсветкой в управлении, отличительный дизайн и небольшая ширина монитора.\n\nВозможно подключение к многоквартирному ауди домофону с помощью блока сопряжения.\n\nМаксимальная конфигурация подключения - две вызывные панели, два монитора и две аудиотрубки.\nСхема подключения Kocom KCV-401EV\n\nКрасный — аудиосигнал\nСиний — общий\nЖелтый — питание 12 вольт\nБелый — видео\nТехнические характеристики Kocom KCV-401EV\n\nПроизводитель	Kocom. Ltd.\nСистема цветности	PAL/NTSC\nРазмер экрана по диагонали	4 дюймов \nПодсветка	LED\nРегулировка яркости, контрастности	да\nСистема Hands-free (свободные руки)	да\nРегулировка громкости	да\nКоличество мелодий вызова	1\nТип мелодии	тональный\nВстроенная память	нет\nВидеовыходов	2 видео 2 аудио\nТип управления	кнопки\nСоединение с вызывной панелью	4-х проводное\nMax длина провода домофон-видеопанель	50 метров\nИнтерфон	есть, DP-4VН\nКорпус	пластик\nЦвет	белый,перламутр\nДиапазон рабочих температур	0… +50С\nНапряжение сети	100-240В 50/60Гц.\nПотребляемая мощность	1Вт-6,25Вт\nВес	1,9 кг.\nРазмер (В*Ш*Г) с учётом трубки	19.5 см х14 см х3.4 см\nСпособ установки	накладной\nЯзык меню	русский, английский\nИнструкция Kocom KCV-401EV\n\nПодробная инструкция для видеодомофона Kocom KCV-401EV поставляется в комплекте с монитором!\nУстановка Kocom KCV-401EV\n\nСтоимость установки комплекта видеодомофона Kocom KCV-401EV уточняйте у наших менеджеров по телефону. Стандартный монтаж видеодомофона как правило не превышает 4000 тыс рублей с учетом всех расходных материалов.\n\nМодификация Kocom KCV-401EV\n\nАдаптированный для подключения к аналоговыми домофонам - Kocom KCV-401EV/Vizit\n\nАдаптированный для подключения к цифровым домофонам - Kocom KCV-401EV/XL', '', '0.