(421, '28301738-8c6c-11e3-9764-8fa38e4e9484', '0', '', 'f807da96-8c67-11e3-9764-8fa38e4e9484', 'Видеодомофон Kocom KVR-A510', 'Видеодомофон Kocom KVR-A510 10 дюймовый сенсорный видеодомофон со встроенным видеорегистратором на 4 канала и поддержкой IP, запись видео по датчику движения или по расписанию. Расчитан на подключение  4 вызывных видеопанелей или видеокамер. Интерком между абонентскими устройствами до 4 мониторов. Запись видеороликов в реальном времени. IP - выход для передачи информации о звонившем госте по электронной почте или в виде смс на мобильный телефон. Возможна адаптация к подъездному аудиодомофону через блок сопряжения. \n\nСистема умный дом: управление светом (плавное), шторами, и тд. В спящем режиме видеодомофон Kocom KVR-A510 может использоваться как  фоторамка, с календарем и часами. \n\nМеню русифицировано. Цифровое двукратное увеличение в режиме реального времени. Режим "картинка в картинке". Множество протоколов управления PTZ камерами.Поиск по времени, календарю, событиям. Копирование на SD карту, внешний HDD и по сети.Поддержка Web интерфейса.Поддержка DDNS, мобильных телефонов 3G, iPhone.IP\nСхема подключения Kocom KVR-A510\n\nКрасный — аудиосигнал\nСиний — общий\nЖелтый — питание 12 вольт\nБелый — видео\nТехнические характеристики Kocom KVR-A510\n\n\n\n- Подключение до 4 абонентских устройств (включая аудио трубку KDP-602G),\n- Подключение до 4 вызывных панелей или видеокамер,\n- Интерком между абонентскими устройствами,\n- Режим просмотра видео от камер и возможность открывания электрозамка,\n- Запись видео в реальном времени,\n- IP видеодомофон с подключением к Интернету,\n- Поддержка домашней автоматики: управление светом (плавное), шторами, газовым клапаном (по RS-485),\n- Управление с сенсорного экрана вручную, по расписаниям и сценариям,\n- Отображение цифрового фотоальбома, календаря, часов, хранитель экрана,\n- Видеорегистратор на 4 канала,\n- Пентаплексный автономный видеорегистратор,\n- Формат сжатия H.264,\n- Запись в реальном времени с разрешением D1/2,\n- Управление с сенсорного экрана, мышью, сенсорными кнопками лицевой панели,\n- Поддержка многих языков,\n- Изображение без интерлейсинга,\n- Схема слежения за работоспособностью,\n- Цифровое увеличение 2Х,\n- Режим "картинка в картинке",\n- Множество протоколов управления PTZ камерами,\n- Запись по датчику, постоянно, по расписанию, по движению,\n- Предзапись (0-30 с), постзапись (0-120с),\n- Поиск по времени, календарю, событиям и Первая/Последняя запись,\n- Копирование на SD карту, внешний HDD и по сети,\n- Функции тревоги (оповещение по электронной почте, выход тревоги, зуммер по событиям и потере видео),\n- Двойной поток по сети,\n- Поддержка web интерфейса (наблюдение, воспроизведение, сохранение стоп кадров и управление PTZ),\n- ПО центрального пульта (наблюдение до 64 каналов),\n- Воспроизведение, копирование, управление PTZ, перезапуск локальных DVR,\n- Поддержка DDNS, мобильных телефонов 3G, iPhone.\nИнструкция Kocom KVR-A510\n\nПодробная инструкция на русском языке для видеодомофона Kocom kvr-a510 поставляется в комплекте с монитором!\nУстановка Kocom KVR-A510\n\nСтоимость установки комплекта видеодомофона Kocom KVR-A510 уточняйте у наших менеджеров по телефону. Стандартный монтаж видеодомофона как правило не превышает 4000 тыс рублей с учетом всех расходных материалов.\n\n', '', '0.00', 1, 0, 0, 'item421', '', '', '', 0),
(422, '2830173b-8c6c-11e3-9764-8fa38e4e9484', '0', '', 'f807da95-8c67-11e3-9764-8fa38e4e9484', 'Видеодомофон Slinex GL-08', 'Видеодомофон Slinex GL-08 уникален в своем роде, так ка имеет встроенный видеорегистратор (технология FriBit). \n\nПринимает жесткий диск 500 ГБ, что позволяет ему заменить полноценную систему видеонаблюдения. Возможно подключить 4 камеры наблюдения и 2 вызывные панели. Дисплей восемь дюймов.\n\nДисплей   	  8" color TFT LCD 4:3\nУникальные функции   	  Функция DVR, квадратор, подключение датчиков, подключение к сети\nРазрешение экрана   	  800x600\nКол-во вызывных панелей   	  2\nКол-во дополнительных видеокамер   	  4\nФункция памяти   	  SATA винчестер, объем до 500 Гб\nПотребление питания   	  10Вт + (зависит от кол-ва подключаемых камер)\nПитание   	  DC 12V, адаптер в комплекте\nИнтерком   	  Нет\nТип установки   	  Настенная накладная установка, настольный кронштейн в комплекте\nЦветовые решения   	  Белый/Черный\nРазмеры   	  250 мм х 210 мм х 35 мм (ШхВхГ)\n', '', '0.00', 0, 0, 0, 'item422', '', '', '', 0),
