(509, '80093889-8dff-11e3-9766-d820c49e8c84', '0', '', '80093867-8dff-11e3-9766-d820c49e8c84', 'ИБП APC Back-UPS RS 500VA', 'ИБП Back-UPS RS обеспечивает высокопроизводительную защиту компьютерных систем для бизнеса и офиса. Он обеспечивает батарейную поддержку, позволяющую продолжить работу при отключениях энергоснабжения средней и большой продолжительности. Кроме того, устройство защитит ваше оборудование от разрушительных скачков и перепадов напряжения, проникающих через электрические и телефонные линии, а также через линию локальной сети. Отличительная черта ИБП Back-UPS RS — схема автоматической стабилизации напряжения (AVR). Схема AVR мгновенно корректирует пониженное или повышенное напряжение электросети до безопасного уровня, поэтому вы сможете работать неограниченно долго в условиях как пониженного, так и повышенного напряжения, сохраняя энергию батареи на случай полного отключения энергоснабжения. В случае продолжительного отключения программное обеспечение автоматически завершит работу вашей компьютерной системы. Благодаря таким конструктивным решениям, как звуковые сигналы, индикаторы состояния, батарея с возможностью замены пользователем, переустанавливаемые кнопочные предохранители и многочисленные розетки (в том числе с увеличенным интервалом для трансформаторных блоков), ИБП Back-UPS RS станет отличным выбором для защиты результатов вашего бизнеса от постоянной угрозы отключений энергоснабжения и потери данных.\nОбщие параметры\nЦвет	черный\nОсновные характеристики\nТип	линейно-интерактивный\nМодель	APC Back-UPS RS 500VA\nАвтоматический регулятор напряжения (AVR)	есть\nВыходная мощность (полная)	500 ВА\nВыходная мощность (активная)	300 Вт\nВремя работы при полной нагрузке	5.8 мин\nВремя работы при половинной нагрузке	12.4 мин\nФорма выходного сигнала	ступенчатая аппроксимация синусоиды\nМакс. поглощаемая энергия импульса	300 Дж\nКоличество выходных разъемов питания (общее)	4\nКоличество выходных разъемов питания (UPS)	3\nВход / Выход\nВходное напряже