(511, '80093880-8dff-11e3-9766-d820c49e8c84', '0', '', '80093867-8dff-11e3-9766-d820c49e8c84', 'ИБП IPPON Back Comfo PRO 800', 'Back Comfo Pro - удобный источник бесперебойного питания для домашних и корпоративных пользователей компьютерной техники. Для удобства пользователей Back Comfo Pro оборудованы 8-ю розетками европейского типа для бытовой техники. Все розетки расположены на верхней стороне корпуса ИБП, шесть из них обладают батарейной поддержкой, а оставшиеся две обеспечивают только сетевую фильтрацию. Так же сверху находятся два разъема для защиты телефонной линии от электрических помех и скачков напряжения. Для подключения к компьютеру имеются стандартные COM (RS-232) и USB порты. Вместе с UPS поставляется русифицированное программное обеспечение WinPower, которое позволяет эффективно контролировать все параметры работы источников бесперебойного питания. Отличительными особенностями данного программного обеспечения являются широчайшие возможности настроек. Среди них - оповещение о событиях по локальной сети, электронной почте, через SMS-сообщения, пейджер, ведение журнала событий и др. Различные состояния работы ИБП Back Comfo Pro можно отслеживать с помощью 3-х светодиодных индикаторов (красный, желтый, зеленый) и через звуковые сигналы.\nОсновные характеристики\nТип	линейно-интерактивный\nАвтоматический регулятор напряжения (AVR)	есть\nВыходная мощность (полная)	800 ВА\nВремя работы при полной нагрузке	5 мин\nКоличество выходных разъемов питания (общее)	8\nКоличество выходных разъемов питания (UPS)	6\nОсновные характеристики\nТип выходных разъемов питания	CEE 7\nВозможность установки в стойку	нет\nУправление\nИнтерфейсы	RJ-11/RJ-45, RS-232, USB\nЗащита\nЗащита телефонной линии	есть\nЗащита локальной сети	нет\nЦена:4260\n', '', '0.00', 1, 0, 0, 'item511', '', '', '', 0),
