(514, '80093877-8dff-11e3-9766-d820c49e8c84', '0', '', '80093867-8dff-11e3-9766-d820c49e8c84', 'ИБП IPPON Back Power PRO 400', 'Источники бесперебойного питания (UPS) серии Back Power Pro предназначены для защиты персональных компьютеров и рабочих станций от основных неполадок с электропитанием: высоковольтных выбросов, электромагнитных и радиочастотных помех, понижений, повышений и полного исчезновения напряжения в электросети. Данные ИБП (UPS) имеют функцию циклического самотестирования и снабжены функцией Green Power, которая при пропадании напряжения в сети и отсутствии нагрузки автоматически выключит ИБП (UPS) через 5 минут. Все ИБП (UPS) серии Back Power Pro комплектуются программным обеспечением на CD, благодаря которому на экране монитора отображаются такие диагностические симптомы, как напряжение, частота, уровень заряда аккумулятора, уровень нагрузки и т.п. В комплект каждого ИБП входят телефонный шнур и кабели для USB-порта и подключения нагрузки.\nОсновные характеристики\nТип	линейно-интерактивный\nАвтоматический регулятор напряжения (AVR)	есть\nВыходная мощность (полная)	400 ВА\nВремя работы при полной нагрузке	5 мин\nКоличество выходных разъемов питания (общее)	3\nКоличество выходных разъемов питания (UPS)	3\nОсновные характеристики\nТип выходных разъемов питания	IEC 320\nВозможность установки в стойку	нет\nУправление\nИнтерфейсы	RJ-11/RJ-45, USB\nЗащита\nЗащита телефонной линии	есть\nЗащита локальной сети	нет\nЦена:2508\n', '', '0.00', 1, 0, 0, 'item514', '', '', '', 0),
