(517, '8009386e-8dff-11e3-9766-d820c49e8c84', '0', '', '80093867-8dff-11e3-9766-d820c49e8c84', 'ИБП IPPON Back Verso 600 lite version', 'Источники бесперебойного питания (UPS) серии Back Verso предназначены для защиты компьютерной и бытовой техники: домашних кинотеатров, DVD-плееров, LCD-панелей, акустических систем, персональных компьютеров и мониторов от основных неполадок с электропитанием: высоковольтных выбросов, электромагнитных и радиочастотных помех, понижений, повышений и полного исчезновения напряжения в электросети. Данные ИБП (UPS) имеют функцию циклического самотестирования и снабжены функцией Green Power, которая при пропадании напряжения в сети и отсутствии нагрузки автоматически выключит ИБП (UPS) через 5 минут. ИБП IPPON Back Verso рекомендованы для домашнего использования и позволяют подключать до шести устройств одновременно: 4 евро-розетки черного цвета обладают батарейной поддержкой и ещё 2 дополнительные белые розетки ограничены функционалом сетевого фильтра. Также предусмотрены специальные гнезда для защиты телефонной линии.\nОсновные характеристики\nТип	резервный\nАвтоматический регулятор напряжения (AVR)	нет\nВыходная мощность (полная)	600 ВА\nВремя работы при полной нагрузке	5 мин\nКоличество выходных разъемов питания (общее)	6\nКоличество выходных разъемов питания (UPS)	4\nОсновные характеристики\nТип выходных разъемов питания	CEE 7\nВозможность установки в стойку	нет\nУправление\nИнтерфейсы	RJ-11/RJ-45\nЗащита\nЗащита телефонной линии	есть\nЗащита локальной сети	есть\nЦена:2268\n', '', '0.00', 1, 0, 0, 'item517', '', '', '', 0),
