(596, 'a21c3e96-8d3b-11e3-9765-a72e7bc75d84', '0', '', '2277deb0-8d34-11e3-9765-a72e7bc75d84', 'Ключ DS TM-1990A F5', 'Электронный TM ключ  DS 1990A - F5 (Dallas с фиксированным 64-битным кодом с держателем). Стандартный идентификатор для систем контроля доступа на базе ТМ. Чип в герметичном корпусе из нержавеющей стали. Контактный способ считывания.\n', '', '0.00', 1, 0, 0, 'item596', '', '', '', 0),
(597, 'a21c3e9f-8d3b-11e3-9765-a72e7bc75d84', '0', '', '2277deb0-8d34-11e3-9765-a72e7bc75d84', 'Кнопка с подсветкой', 'Кнопка  "Цифрал" - (с подсветкой) Металлический литой антивандальный корпус, покраска - ударостройкой порошковой краской, имеет современный дизайн.\n', '', '0.00', 1, 0, 0, 'item597', '', '', '', 0),
(598, 'a21c3ec1-8d3b-11e3-9765-a72e7bc75d84', '0', '', 'a21c3ec0-8d3b-11e3-9765-a72e7bc75d84', 'Комплект цветного видеодомофона для офиса  1', 'Комплект цветного видеодомофона для офиса состоит из полного набора оборудования для монтажа. Единственное что Вам остается сделать: проложить кабель и подключить оборудование согласно инструкций.\n \nВ состав комплекта для установки цветного видедомофона в офис состоит из 8 наименований: 1) Видеодомофон Commax CDV-35A, 2) блок питания, 3)антивандальная вызывная панель Activision AVC-305 с цветной видеокамерой, 4) контроллер для управления работой замка, 5) накладной контактор для считывания ключей, 6)компактный электромагнитный замок, 7) пластиковая накладная кнопка выхода и 8) 5 ключей для сотрудников. Если Вам понадобится большее количество ключей - Вы сможете их легко дозаказть.\n \nУстановка цветного видеодомофона в офис не требует высоквалифицированного специалиста и может быть выполнена обычным электриком или человеком, который досканально изучит инструкции к оборудованию. Цена 8750\n', '', '0.00', 1, 0, 0, 'item598', '', '', '', 0),
(599, 'a21c3ece-8d3b-11e3-9765-a72e7bc75d84', '0', '', 'a21c3ec0-8d3b-11e3-9765-a72e7bc75d84', 'Комплект цветного видеодомофона для офиса  2', 'Готовый комплект цветного видеодомофона Commax 35A/AVC с замком содержит все необходимое для самостоятельной установки видеодомофона в загородном доме или в тамбуре квартиры.\n \nПолностью готовый комплект для самостоятельной установки видеодомофона с замком включает в себя следующее:\n \n- Цветной видеодомофон с трубкой. Размер экрана 4.5 " или 10,5 см по диагонали, поддерживает подключение до 2-х панелей или обзорных камер. Накладное крепление на стену, питание 220В. \n \n-  Вызывная панель в антивандальном корпусе, поворотная планка и защитный козырек в комплекте. Характеристики встроенной видеокамеры: 420 ТВл, 12В питание, угол обзора 75 (гор.) 55 (верт.) ИК подсветка 0.6 м. Питание вызывной панели осуществляется от монитра.\n \n- Блок питания трансформаторный блок питания, расчитаный на постоянную работу. Входное напряжение 220В; выход 12В 0,7А\n \n- Электромеханический замок. Выполнен в металлическом корпусе, монтируется накладным способом. В комплекте ответкая часть ригеля, внешняя личинка, и 5 ключей.\n \nГарантия на весь комплект составляет 1год.\n \nОбщий принцип установки комплекта видеодомофона с замком:\n1) На калитку или дверь устанавливается электромеханический замок и готовится место для вызывной панели;\n2) Провод от замка проводится к месту коммутации вызывной панели \n3) прокладывается два кабеля: 1-й для соединения вызывной панели и видеодомофона; 2-й для подачи питания с блока на замок\n4) блок питания может быть установлен в любом месте, (подвале, распределительном щите и т.д.) провода питающие замок подводятся к нему\n5) устанавливается монитор в помещении и соединяется с многожильным кабелем, идущим к панели.\n6) на месте коммутации панели около калитки многожильный выход коммутируется с многожильным кабелем. второй выход панели (управляющий, состоящий из двух жилок) поключается на провод питания замка, разрывая его. Обычно подключение идет на плюсовую жилу. Минус с блока питания подключается напрямую к проводу замка. Цена 7850\n', '', '0.00', 1, 0, 0, 'item599', '', '', '', 0),
(600, 'a21c3eaf-8d3b-11e3-9765-a72e7bc75d84', '0', '', 'a21c3ea8-8d3b-11e3-9765-a72e7bc75d84', 'Контроллер Gate-4000', 'Контроллер Gate-4000 - (Сетевой) для электромагнитных и электромеханических замков. 2 считывателя, 2 релейных выхода. Типы (протоколы) подключаемых считывателей: Wiegand26, Dallas Touch Memory. Кол ключей: 4000, кол запоминаемых событий: 4000, кол расписаний: 8, кол охранных входов: 4, t : -20°С до +50°С.  RS422, RS485.\n', '', '0.00', 0, 0, 0, 'item600', '', '', '', 0),
