(666, '9658cc0c-8d5c-11e3-9765-a72e7bc75d84', '0', '', '9658cc05-8d5c-11e3-9765-a72e7bc75d84', 'Монитор BenQ 18.5" GL955A', 'Великолепное качество изображения.\nПреимущества LED подсветки. Использование в мониторах LED подсветки дает ощутимые преимущества по сравнению с обычно используемой CCFL подсветкой. Эти преимущества включают наряду с высоким уровнем динамической контрастности, отсутствием белесой засветки и фликкеринга, также и снижение вредных выбросов в атмосферу при производстве мониторов и их переработке. \nПотрясающий уровень динамической контрастности. \nУровень динамической контрастности монитора GL955A составляет 12''000''000:1, что позволяет кардинально улучшить качество изображения и увидеть даже мельчайшие детали в самых темных и сложных визуальных сценах. Все оттенки - от самого черного до самого белого - передаются с потрясающей четкостью, создавая по-настоящему насыщенное изображение. \nОтличное время отклика. \nМонитор оснащен быстрой матрицей с временем отклика 5 мс, обеспечивая четкость и плавность быстро движущихся объектов. \nТехнология SENSEYE®. \nБлагодаря эксклюзивной технологии BenQ Senseye®, которая позволяет настроить изображение по 6 параметрам, монитор BenQ GL955A обеспечивает отображение живых, насыщенных цветов. Пять предустановленных режимов отображения (Стандартный, Кино, Игра, Фото, sRGB) помогут оптимально настроить картинку нажатием одной кнопки. Дополнительный режим Эко поможет сократить энергопотребление.\n\nОбщие характеристики\nЦвет	черный\nДиагональ экрана	18.5"\nМаксимальное разрешение	1366x768\nLED подсветка	есть\nТехнология изготовления матрицы	TN\nТип ЖК-матрицы	TN+film (Twisted Nematic + film)\n3D Ready	нет\nТВ тюнер	нет\nЭкран\nЯркость	200 кд/м2\nКонтрастность	600:1\nДинамическая контрастность	12М:1\nЭкран\nВремя отклика	5 мс\nУгол обзора по горизонтали	90°\nУгол обзора по вертикали	50°\nИнтерфейсы\nТип входов	VGA (D-Sub)\nФункции\nСтереоколонки	нет\nРегулировка наклона	есть\nКорпус, габариты\nШирина с подставкой	459 мм\nМинимальная высота с подставкой	362 мм\nМаксимальная высота с подставкой	362 мм\nТолщина с подставкой	164 мм\nЦена 4232\n', '', '0.00', 1, 0, 0, 'item666', '', '', '', 0),
