(668, '9658cc0e-8d5c-11e3-9765-a72e7bc75d84', '0', '', '9658cc05-8d5c-11e3-9765-a72e7bc75d84', 'Монитор BenQ 21.5" GW2265M', 'BenQ - один из ведущих производителей LED мониторов выпустил новую серию мониторов для дома и офиса с матрицей VA и светодиодной подсветкой - серия GW. В результате качество изображения вышло абсолютно на новый уровень. Более глубокий черный цвет, высокий уровень статической контрастности позволят Вам разглядеть даже самые мелкие детали. Наслаждайтесь ярким, живым, максимально приближенным к реальности изображением с новыми мониторами серии GW.\nОбщие характеристики\nЦвет	черный\nДиагональ экрана	21.5"\nМаксимальное разрешение	1920x1080\nLED подсветка	есть\nТехнология изготовления матрицы	VA\nТип ЖК-матрицы	VA (Vertical Alignment)\nСоотношение сторон	16:9\n3D Ready	нет\nТВ тюнер	нет\nЭкран\nСенсорный экран	нет\nЯркость	250 кд/м2\nКонтрастность	3000:1\nДинамическая контрастность	20M:1\nЭкран\nВремя отклика	6 мс\nУгол обзора по горизонтали	178°\nУгол обзора по вертикали	178°\nИнтерфейсы\nТип входов	DVI, VGA (D-Sub)\nUSB-концентратор	нет\nВыход на наушники	есть\nФункции\nСтереоколонки	есть\nРегулировка наклона	есть\nДополнительно\nРазмер VESA	100x100\nКорпус, габариты\nШирина с подставкой	510 мм\nМаксимальная высота с подставкой	397 мм\nТолщина с подставкой	186 мм\nЦена: 5336\n', '', '0.00', 1, 0, 0, 'item668', '', '', '', 0),
(669, '5df88b34-8d64-11e3-9765-a72e7bc75d84', '0', '', '9658cc05-8d5c-11e3-9765-a72e7bc75d84', 'Монитор BenQ 23" GW2320', 'Использование в мониторах LED подсветки дает ощутимые преимущества по сравнению с обычно используемой CCFL подсветкой. Эти преимущества включают наряду с высоким уровенем динамической контрастности, отсутствием белесой засветки и фликкеринга, также и снижение вредных выбросов в атмосферу при производстве мониторов и их переработке.\nВ мониторе GW2320 фликеринг отсутствует на всех уровнях яркости. Работа за этим мониторм обеспечит вам больший комфорт для глаз и меньшую утомляемость.\nIPS мониторы имеют широкие углы обзора 178º/178º, что позволяет наслаждаться одинаково качественным изображением почти из любого угла помещения без ущерба качеству и яркости картинки на экране монитора.\nУровень динамической контрастности монитора GW2320 составляет 20M:1. Это позволяет увидеть даже мельчайшие детали изображения в самых темных и сложных визуальных сценах. Все оттенки - от самого черного до самого белого - передаются с потрясающей четкостью, создавая по-настоящему насыщенное изображение.\nНаслаждайтесь просмотром динамических сцен без надоедливых артефактов изображения, ведь ЖК-панель монитора имеет отклик в 5 мс GTG!\nУбедитесь в великолепном отображении цвета, обеспечиваемом технологией BenQ Senseye®, основанной на восприятии изображения человеческим глазом. С помощью шести различных калибрационных техник, Senseye® 3 обеспечивает лучшее визуальное качество изображения во всех своих 6 режимах: Стандартном, Кино, Игра, Фото, RGB и Эко – режим, специально разработанный для экономии электроэнергии.\nОбщие характеристики\nЦвет	черный\nДиагональ экрана	23"\nМаксимальное разрешение	1920x1080\nLED подсветка	есть\nТехнология изготовления матрицы	IPS\n3D Ready	нет\nТВ тюнер	нет\nЭкран\nСенсорный экран	нет\nЯркость	250 кд/м2\nЭкран\nКонтрастность	1000:1\nДинамическая контрастность	20M:1\nВремя отклика	5 мс\nУгол обзора по горизонтали	178°\nУгол обзора по вертикали	178°\nИнтерфейсы\nТип входов	DVI, VGA (D-Sub)\nUSB-концентратор	нет\nФункции\nСтереоколонки	нет\nЦена 6440\n', '', '0.00', 1, 0, 0, 'item669', '', '', '', 0),
(670, '9658cc10-8d5c-11e3-9765-a72e7bc75d84', '0', '', '9658cc05-8d5c-11e3-9765-a72e7bc75d84', 'Монитор BenQ 24" GL2460HM', 'Модель BenQ GL2460HM можно рассматривать в качестве примера высокотехнологичного монитора, имеющего ряд показателей, которые приближаются к максимальным в данном классе устройств. В первую очередь обращает на себя внимание сверхнизкое время отклика матрицы - всего 2 мс. Это позволяет рассматривать данный монитор в качестве геймерского, поскольку в динамичных сценах за движущимися предметами не будет шлейфов и артефактов.\n\nВ данном мониторе использована широкоформатная матрица с соотношением сторон 16:9, размером по диагонали 24 дюйма и разрешением 1920x1080 пикселей. Эти параметры экрана позволяет комфортно смотреть фильмы и запускать игры с высокой детализацией изображения. Монитор BenQ GL2460 HM отличается высоким показателем яркости - 250 кд/м2, поэтому даже в яркий солнечный день изображение на экране выглядит насыщенным.\n\nКонструкторы монитора GL2460HM предложили пользователю самому определиться, каким образом подключать данный девайс к компьютеру. Он имеет традиционный аналоговый VGA интерфейс, который дополняют цифровые DVI-D и HDMI. Также в данном мониторе есть два стереодинамика по 1 Вт. Если пользователю необходимо слушать музыку в фоновом режиме, то их мощности для этого будет достаточно.\nОбщие характеристики\nЦвет	черный\nДиагональ экрана	24"\nМаксимальное разрешение	1920x1080\nLED подсветка	есть\nТехнология изготовления матрицы	TN\nТип ЖК-матрицы	TN+film (Twisted Nematic + film)\n3D Ready	нет\nТВ тюнер	нет\nЭкран\nСенсорный экран	нет\nЯркость	250 кд/м2\nКонтрастность	1000:1\nДинамическая контрастность	12М:1\nВремя отклика	2 мс\n\nЭкран\nУгол обзора по горизонтали	170°\nУгол обзора по вертикали	160°\nИнтерфейсы\nТип входов	DVI, HDMI, VGA (D-Sub)\nUSB-концентратор	нет\nВыход на наушники	есть\nФункции\nСтереоколонки	есть\nМощность динамиков	2x1 Вт\nДополнительно\nРазмер VESA	100x100\nКорпус, габариты\nШирина с подставкой	565 мм\nМинимальная высота с подставкой	434 мм\nМаксимальная высота с подставкой	434 мм\nТолщина с подставкой	194 мм\nЦена: 8700\n', '', '0.00', 1, 0, 0, 'item670', '', '', '', 0),
