(675, '5df88b2e-8d64-11e3-9765-a72e7bc75d84', '0', '', '9658cc05-8d5c-11e3-9765-a72e7bc75d84', 'Монитор Samsung 18.5" S19C200N', 'Samsung S19C200N монитор с узкими краями рамки экрана, имеет не только более эстетичный вид, но и ряд преимуществ. Функция Magic Angle позволит наслаждаться четким и качественным изображением под удобным Вам углом. Пять возможных режимов помогут Вам настроить картинку таким образом, что просмотр будет комфортным в любом положении: сверху, снизу или сбоку. Мониторы Samsung серии SС200 обладают высоким уровнем эргономики. Решение для организации подключаемых проводов, с помощью него провода будут аккуратно сложены в ногу монитора и будут видны только у его основания, также ручка для переноски монитора и встроенный блок питания, сохранят порядок на вашем рабочем месте. Режим динамической контрастности (DC) предназначен для лучшего отображения быстро меняющихся сцен, например, при просмотре фильмов или в динамичной игре. Монитор анализирует входной видеосигнал, а затем регулирует яркость светодиодной подсветки в зависимости от яркости конкретного кадра. В результате увеличивается соотношение между уровнями яркости белого цвета самого яркого кадра и черного цвета наименее освещенного кадра, иначе говоря, растет динамическая контрастность изображения.\nХарактеристики\nОбщие характеристики\nЦвет	черный\nДиагональ экрана	18.5"\nМаксимальное разрешение	1366x768\nLED подсветка	есть\nТехнология изготовления матрицы	TN\nТип ЖК-матрицы	TN+film (Twisted Nematic + film)\n3D Ready	нет\nТВ тюнер	нет\nЭкран\nСенсорный экран	нет\nЯркость	250 кд/м2\nКонтрастность	1000:1\nВремя отклика	5 мс\n\nЭкран\nУгол обзора по горизонтали	170°\nУгол обзора по вертикали	160°\nИнтерфейсы\nТип входов	VGA (D-Sub)\nUSB-концентратор	нет\nВыход на наушники	нет\nФункции\nСтереоколонки	нет\nРегулировка наклона	есть\nДополнительно\nРазмер VESA	100x100\nКорпус, габариты\nШирина с подставкой	441 мм\nМинимальная высота с подставкой	349 мм\nМаксимальная высота с подставкой	349 мм\nТолщина с подставкой	170 мм\nЦена: 4439\n', '', '0.00', 1, 0, 0, 'item675', '', '', '', 0),
