(677, '5df88b2c-8d64-11e3-9765-a72e7bc75d84', '0', '', '9658cc05-8d5c-11e3-9765-a72e7bc75d84', 'Монитор Samsung 20" S20C200B', 'Монитор Samsung S20C200B – отличное решение, сочетающее в себе как элегантный вид, так и качественные характеристики. Корпус модели сделан из матового пластика. Он сохранит отличный внешний вид, устойчив к незначительным царапинам и повреждениям. Рамка экрана имеет узкие края, что очень удобно при использовании сразу нескольких мониторов данной модели. С обратной стороны имеется аккуратная ручка для комфортной транспортировки устройства. Его размеры компактны (473.8x367.1x170 мм), а вес составляет всего 2.65 кг. Подставка – регулируемая (от -1° до +20°).\n\nПри разработке Samsung S20C200B была применена уникальная технология Magic Angle, позволяющая наблюдать четкую и качественную картинку под разными углами к плоскости экрана. Для этих целей имеются 5 специальных режимов. Данные режимы направленны на настройку изображение таким образом, что просмотр монитора будет комфортным практически при любом его расположении. Конечно же, при этом следует учитывать диапазон углов обзора. По горизонтали – 170, а по вертикали - 160 градусов.\n\nSamsung S20C200 B обладает дисплеем диагональю 20" и максимальным разрешением экрана 1600x900 пикселей. Панель работает на основе LED-технологии. Палитра цветовых оттенков на высшем уровне – 16.7 млн. Время отклика пиксела быстрое и составляет 5 мс. Динамическая контрастность находится на мега-уровне (Mega DCR), а статическая контрастность равна 1000:1. Монитор автоматически регулирует яркость изображения, которая достигает – 250 кд/м². Всё это положительно сказывается на четкости и детализации картинки.\nОбщие характеристики\nЦвет	черный\nДиагональ экрана	20"\nМаксимальное разрешение	1600x900\nLED подсветка	есть\nТехнология изготовления матрицы	TN\nТип ЖК-матрицы	TN+film (Twisted Nematic + film)\n3D Ready	нет\nТВ тюнер	нет\nЭкран\nСенсорный экран	нет\nЯркость	250 кд/м2\nКонтрастность	1000:1\nВремя отклика	5 мс\nЭкран\nУгол обзора по горизонтали	170°\nУгол обзора по вертикали	160°\nИнтерфейсы\nТип входов	DVI, VGA (D-Sub)\nUSB-концентратор	нет\nВыход на наушники	нет\nФункции\nСтереоколонки	нет\nРегулировка наклона	есть\nДополнительно\nРазмер VESA	100x100\nКорпус, габариты\nШирина с подставкой	474 мм\nМинимальная высота с подставкой	367 мм\nМаксимальная высота с подставкой	367 мм\nТолщина с подставкой	170 мм\nЦена:5451\n', '', '0.00', 1, 0, 0, 'item677', '', '', '', 0),
(678, '9658cc18-8d5c-11e3-9765-a72e7bc75d84', '0', '', '9658cc05-8d5c-11e3-9765-a72e7bc75d84', 'Монитор Samsung 21.5" S22C200NY', 'Samsung S22C200NY позволяет достичь высокой детализации даже в темных сценах или при быстрой смене кадров, гарантируя потрясающе четкое изображение при просмотре фильмов и в видеоиграх.\nОбщие характеристики\nЦвет	черный\nДиагональ экрана	21.5"\nМаксимальное разрешение	1920x1080\nLED подсветка	есть\nТехнология изготовления матрицы	TN\nТип ЖК-матрицы	TN+film (Twisted Nematic + film)\n3D Ready	нет\nТВ тюнер	нет\nЭкран\nСенсорный экран	нет\nЯркость	200 кд/м2\nКонтрастность	600:1\nВремя отклика	5 мс\nЭкран\nУгол обзора по горизонтали	90°\nУгол обзора по вертикали	65°\nИнтерфейсы\nТип входов	VGA (D-Sub)\nUSB-концентратор	нет\nВыход на наушники	нет\nФункции\nСтереоколонки	нет\nДополнительно\nРазмер VESA	100x100\nКорпус, габариты\nШирина с подставкой	504 мм\nМинимальная высота с подставкой	385 мм\nМаксимальная высота с подставкой	385 мм\nТолщина с подставкой	185 мм\nЦена: 5405\n', '', '0.00', 1, 0, 0, 'item678', '', '', '', 0);
INSERT INTO `shop_items` (`id`, `item_id`, `owner_id`, `article`, `parent_group_id`, `name`, `description`, `small_desc`, `price_old`, `remains`, `is_hit`, `is_new`, `uri`, `md`, `mk`, `title`, `inprice`) VALUES
(679, '5df88b2a-8d64-11e3-9765-a72e7bc75d84', '0', '', '9658cc05-8d5c-11e3-9765-a72e7bc75d84', 'Монитор Samsung 23.6" S24C350BL', 'В монитор Samsung встроена функция Eco Saving, с помощью которой можно контролировать энергопотребление монитора. Она позволяет выбрать один из трех режимов яркости свечения экрана, что в свою очередь корректирует яркость, и это положительно влияет на энергопотребление, а это поможет сберечь окружающую среду. Экономьте электроэнергию с помощью режима "Eco saving".\nМонитор Samsung качественно выделяется своим стильным дизайном и глянцевым корпусом. Без каких-либо излишеств, монитор одновременно выглядит стильно и минималистично, но при этом как и любое технологичное устройство - сложно. Уникальная конструкция подставки экономит место, что позволяет вписать монитор в любой интерьер.\nБлагодаря динамической контрастности Mega DCR отображаемая картинка всегда будет качественной, контрастность выской, черный цвет всегда будет абсолютно черным, а белый и другие цвета такими яркими, какими их хотели бы видеть вы. Наслаждайтесь отличной картинкой на мониторе Samsung, пока все остальные мониторы будут просто блекнуть на его фоне.\nОбщие характеристики\nЦвет	черный\nДиагональ экрана	23.6"\nМаксимальное разрешение	1920x1080\nLED подсветка	есть\nТехнология изготовления матрицы	TN\nТип ЖК-матрицы	TN+film (Twisted Nematic + film)\n3D Ready	нет\nТВ тюнер	нет\nЭкран\nСенсорный экран	нет\nЯркость	250 кд/м2\nКонтрастность	1000:1\nВремя отклика	5 мс\nЭкран\nУгол обзора по горизонтали	170°\nУгол обзора по вертикали	160°\nИнтерфейсы\nТип входов	DVI, VGA (D-Sub)\nUSB-концентратор	нет\nВыход на наушники	нет\nФункции\nСтереоколонки	нет\nРегулировка наклона	есть\nДополнительно\nРазмер VESA	нет\nКорпус, габариты\nШирина с подставкой	568 мм\nМинимальная высота с подставкой	436 мм\nМаксимальная высота с подставкой	436 мм\nТолщина с подставкой	230 мм\nЦена: 6888\n', '', '0.00', 1, 0, 0, 'item679', '', '', '', 0),
(680, '5df88b24-8d64-11e3-9765-a72e7bc75d84', '0', '', '9658cc05-8d5c-11e3-9765-a72e7bc75d84', 'Монитор ViewSonic 19.5" VA2046a-LED', 'Монитор ViewSonic VA2046a-LED имеет небольшое время отклика, что гарантирует четкость изображения. Монитор обладает экономичной LED-подсветкой. Соотношение сторон экрана составляющее 16:9 и разрешение 1600x900 пикселей не только обеспечивают прекрасную детализацию игр, но и позволяют наслаждаться просмотром фильмов высокого качества.\nОбщие характеристики\nЦвет	черный\nДиагональ экрана	19.5"\nМаксимальное разрешение	1600x900\nLED подсветка	есть\nТехнология изготовления матрицы	TN\nТип ЖК-матрицы	TN+film (Twisted Nematic + film)\n3D Ready	нет\nТВ тюнер	нет\nЭкран\nСенсорный экран	нет\nЯркость	200 кд/м2\nКонтрастность	600:1\nЭкран\nДинамическая контрастность	10M:1\nВремя отклика	5 мс\nУгол обзора по горизонтали	90°\nУгол обзора по вертикали	65°\nИнтерфейсы\nТип входов	VGA (D-Sub)\nUSB-концентратор	нет\nВыход на наушники	нет\nФункции\nСтереоколонки	нет\nРегулировка наклона	есть\nДополнительно\nРазмер VESA	100x100\nЦена: 4184\n', '', '0.00', 1, 0, 0, 'item680', '', '', '', 0),
(681, '5df88b28-8d64-11e3-9765-a72e7bc75d84', '0', '', '9658cc05-8d5c-11e3-9765-a72e7bc75d84', 'Монитор ViewSonic 20" VA2046M-LED', 'Монитор ViewSonic VA2046m-LED — это 20-дюймовый широкоэкранный монитор со светодиодной подсветкой и глянцевой тонкой рамкой, идеально подходящий для использования как дома, так и в офисе. Благодаря разрешению 1600x900 и динамическому коэффициенту контрастности 10M:1 монитор VA2046m-LED обеспечивает превосходные яркость и контрастность, тогда как быстрое время отклика, равное 5 мс, гарантирует четкость изображения и плавность воспроизведения. Будучи полноценным мультимедийным центром, этот монитор также имеет два встроенных динамика. Входные разъемы VGA и DVI обеспечивают гибкость и удобство подключений, тогда как крепление VESA гарантирует гибкость установки. Благодаря эффективной светодиодной подсветке и энергосберегающему режиму Eco монитор VA2046m-LED является идеальным выбором экологически безопасного монитора. Кроме того, 3-летняя гарантия вместе с одной из лучших в отрасли политикой эффективного отображения пикселей делают этот стильный, высокопроизводительный монитор VA2046m-LED оптимальным выбором по идеальной цене.\nОбщие характеристики\nЦвет	черный\nДиагональ экрана	20"\nМаксимальное разрешение	1600x900\nLED подсветка	есть\nТехнология изготовления матрицы	TN\nТип ЖК-матрицы	TN+film (Twisted Nematic + film)\n3D Ready	нет\nТВ тюнер	нет\nЭкран\nСенсорный экран	нет\nЯркость	200 кд/м2\nКонтрастность	600:1\nЭкран\nДинамическая контрастность	10M:1\nВремя отклика	5 мс\nУгол обзора по горизонтали	90°\nУгол обзора по вертикали	65°\nИнтерфейсы\nТип входов	DVI, VGA (D-Sub)\nUSB-концентратор	нет\nФункции\nСтереоколонки	есть\nМощность динамиков	2x2 Вт\nРегулировка наклона	есть\nДополнительно\nРазмер VESA	100x100\nЦена: 4324\n', '', '0.00', 1, 0, 0, 'item681', '', '', '', 0),
(682, '5df88b26-8d64-11e3-9765-a72e7bc75d84', '0', '', '9658cc05-8d5c-11e3-9765-a72e7bc75d84', 'Монитор ViewSonic 21.5" VA2246M-LED', 'Монитор Viewsonic VA2246M-LED отлично справляется с решением самых разных задач. Впечатляющие технические характеристики и доступная цена делают его идеальным приобретением для ваших сотрудников в офисе. Работать с этой моделью легко и удобно! Благодаря Full HD разрешению, диагонали 21.5 дюйма и светодиодной подсветке этот монитор подойдёт для просмотра красочных фильмов и захватывающих телепередач. Наличие собственных колонок позволяют просматривать фильмы без подключения дополнительной акустической системы.\nОбщие характеристики\nЦвет	черный\nДиагональ экрана	21.5"\nМаксимальное разрешение	1920x1080\nLED подсветка	есть\nТехнология изготовления матрицы	TN\nТип ЖК-матрицы	TN+film (Twisted Nematic + film)\n3D Ready	нет\nТВ тюнер	нет\nЭкран\nСенсорный экран	нет\nЯркость	250 кд/м2\nКонтрастность	1000:1\nЭкран\nДинамическая контрастность	10M:1\nВремя отклика	5 мс\nУгол обзора по горизонтали	170°\nУгол обзора по вертикали	160°\nИнтерфейсы\nТип входов	DVI, VGA (D-Sub)\nUSB-концентратор	нет\nФункции\nСтереоколонки	есть\nМощность динамиков	2x2 Вт\nРегулировка наклона	есть\nДополнительно\nРазмер VESA	100x100\nЦена: 5324\n', '', '0.00', 1, 0, 0, 'item682', '', '', '', 0),
