(687, '1004f4ee-8974-11e3-9761-fe0d44449e84', '0', '', '1004f4d5-8974-11e3-9761-fe0d44449e84', 'ОВЭ-2(з)-АВЕ-01, Огнетушитель «BONTEL»', 'Огнетушитель «BONTEL» заправлен огнетушащим составом «BONTEL» и относятся к классу воздушно-эмульсионных огнетушителей с тонкораспыленной струей (ОВЭ), предназначенный для тушения пожаров классов А (твердых горючих веществ), В (жидких горючих веществ) и Е (тушение электрооборудования, находящегося под напряжением). Огнетушитель соответствует ГОСТ Р 51057-2001 «Техника пожарная. Огнетушители переносные. Общие технические требования. Методы испытаний» и СП 9.13130.2009 «Техника пожарная. Огнетушители. Требования к эксплуатации».\n', '', '0.00', 0, 0, 0, 'item687', '', '', '', 0),
