(690, '53d5fd09-8a1a-11e3-9763-cb1860b95883', '0', '', '53d5fd08-8a1a-11e3-9763-cb1860b95883', 'П-274 полевой (500м)', 'Кабель П-274 - (Токопроводящие жилы П-274 скручивают из 3-х стальных проволок диаметром 0.3 мм и 4-х медных проволок диаметром 0.3 мм),  с полиэтиленовой изоляционно- защитной оболочкой для полевой связи однопарный,  от-50 до +65°С.\n', '', '0.00', 1, 0, 0, 'item690', '', '', '', 0),
