(867, '53d5fd0c-8a1a-11e3-9763-cb1860b95883', '0', '', '53d5fd0b-8a1a-11e3-9763-cb1860b95883', 'ШВВП 2х0,5 (200м)', 'ШВВП 2х0,5 -  (Шнур соединительный ) с параллельными жилами с поливинилхлоридной изоляцией с поливинилхлоридной оболочкой гибкий, на напряжение до 380 В для систем 380/380 В. Условия эксплуатации:  Окружающая среда - от минус 40oС до плюс 50oС, в условиях монтажных изгибов - до минус 10oС, повышенная влажность воздуха - до 98% при t - до 35oС.\n', '', '0.00', 0, 0, 0, 'item867', '', '', '', 0),
(868, '53d5fd0e-8a1a-11e3-9763-cb1860b95883', '0', '', '53d5fd0b-8a1a-11e3-9763-cb1860b95883', 'ШВВП 2х0,75 (200м)', 'ШВВП 2х0,75 - (Шнур соединительный), изоляция и оболочка  устойчивы к деформации при температуре 70°С и устойчивы к растрескиванию, разрывная прочность изоляции и оболочки не менее 10 МПа и относительное удлинение не менее 150%.\n', '', '0.00', 0, 0, 0, 'item868', '', '', '', 0),
(869, 'a9628283-8a14-11e3-9763-cb1860b95883', '0', '', 'a9628254-8a14-11e3-9763-cb1860b95883', 'ШВЭВ видео +3 жилы (200м)', '"ШВЭВ видео + 3 жилы  белый 200 м  - (Швэв 3*0,12 белый)\n (комбинированный кабель для домофонов и систем контроля доступа), для передачи звукового сигнала и подключения питания, использование кабеля для передачи видеосигнала на небольшие расстояния при невысоком требовании к качеству сигнала. Емкость - 2 гибкие жилы сечением 0,12 мм2 + оплетка одной жилы медной проволокой плотностью не менее 70%,. оболочка - ПВХ, Цвет оболочки - белый, Упаковка - бухта 200 метров. Внешний диаметр - 3,6 мм."\n', '', '0.00', 1, 0, 0, 'item869', '', '', '', 0),
(870, '19db7c8e-8882-11e3-975f-8de75b1fe284', '0', '', '19db7c8d-8882-11e3-975f-8de75b1fe284', 'Шорох-2', 'Извещатель охранный поверхностный вибрационный (одноблочное исполнение), чувствительность к вибрации 0,1..1,6 м/с2, 12В/25мА, IP30, -30…+50°С, вес: 0,2кг, габариты: 100х40х30,5мм. (42шт/кор)\n', '', '0.00', 0, 0, 0, 'item870', '', '', '', 0),
(871, '19db7c92-8882-11e3-975f-8de75b1fe284', '0', '', '19db7c8d-8882-11e3-975f-8de75b1fe284', 'Шорох-2-10', 'Извещатель охранный поверхностный вибрационный (многоблочное исполнение), состав: 1 БОС+10 датчиков вибрации, чувствительность к вибрации 0,1..1,6 м/с2, 12В/75мА, IP30, -30…+50°С, вес: 0,2кг, габариты: Бос - 80х55х28мм, Датчик вибрации - 62х40х32мм.\n\n\n\n', '', '0.00', 0, 0, 0, 'item871', '', '', '', 0),
(872, '8a5edd76-87e8-11e3-975e-ed5d4d1ee984', '0', '', '89e99e08-87e2-11e3-975e-ed5d4d1ee984', 'ЭДУ 513-3АМ', 'Адресное устройство ручного пуска системы пожаротушения со встроенным разделительно-изолирующим блоком, питается по двухпроводной линии от «С2000-КДЛ», до 127 адресов\n', '', '0.00', 1, 0, 0, 'item872', '', '', '', 0),
(873, '8a5edd73-87e8-11e3-975e-ed5d4d1ee984', '0', '', '89e99e08-87e2-11e3-975e-ed5d4d1ee984', 'ЭДУ 513-3М', 'Элемент дистанционного управления электроконтактный. Предназначен для ручного запуска систем пожарной автоматики. \n', '', '0.00', 1, 0, 0, 'item873', '', '', '', 0),
